import React, { useRef, useEffect, useState } from 'react';
import { Pose } from '@mediapipe/pose';
import { Camera } from '@mediapipe/camera_utils';
import { calculateAngle } from './components/calculateAngle'; // Ensure this path is correct

const PushupTracker = () => {
  const videoRef = useRef(null);
  const canvasRef = useRef(null);
  const [counter, setCounter] = useState(0);
  const [stage, setStage] = useState('up');

  useEffect(() => {
    const onResults = (results) => {
      if (!results.poseLandmarks) {
        return;
      }

      const image = results.image;
      const landmarks = results.poseLandmarks;

      const width = image.width;
      const height = image.height;

      // Function to get landmark coordinates relative to image size
      const getCoordinates = (landmark) => [
        landmark.x * width,
        landmark.y * height
      ];

      // Extract specific landmarks for calculations
      const r1 = getCoordinates(landmarks[11]); // Example: RIGHT_SHOULDER
      const r2 = getCoordinates(landmarks[13]); // Example: RIGHT_ELBOW
      const r3 = getCoordinates(landmarks[15]); // Example: RIGHT_WRIST
      const l1 = getCoordinates(landmarks[12]); // Example: LEFT_SHOULDER
      const l2 = getCoordinates(landmarks[14]); // Example: LEFT_ELBOW
      const l3 = getCoordinates(landmarks[16]); // Example: LEFT_WRIST
      const r4 = getCoordinates(landmarks[23]); // Example: RIGHT_HIP
      const r5 = getCoordinates(landmarks[25]); // Example: RIGHT_KNEE
      const r6 = getCoordinates(landmarks[27]); // Example: RIGHT_ANKLE
      const l4 = getCoordinates(landmarks[24]); // Example: LEFT_HIP
      const l5 = getCoordinates(landmarks[26]); // Example: LEFT_KNEE
      const l6 = getCoordinates(landmarks[28]); // Example: LEFT_ANKLE
      const rpalm = getCoordinates(landmarks[17]); // Example: RIGHT_PINKY
      const lpalm = getCoordinates(landmarks[18]); // Example: LEFT_PINKY

      // Calculate angles and distances
      const angleR = calculateAngle(r1, r2, r3);
      const angleL = calculateAngle(l1, l2, l3);
      const backAngleR = calculateAngle(r1, r4, r5);
      const backAngleL = calculateAngle(l1, l4, l5);
      const palmsDistance = Math.hypot(rpalm[0] - lpalm[0], rpalm[1] - lpalm[1]);
      const shoulderDiff = Math.abs(r1[1] - l1[1]);
      const hipDiff = Math.abs(r4[1] - l4[1]);
      const alignmentThreshold = 50;

      // Logic to determine errors and count push-ups
      let hasError = false;
      let upperBodyColor = 'white';
      let lowerBodyColor = 'white';

      if (angleR <= 50 || angleL <= 50) {
        upperBodyColor = 'red';
      }
      if (backAngleR <= 120 || backAngleL <= 120) {
        lowerBodyColor = 'red';
        hasError = true;
      }
      if (palmsDistance < 50) {
        upperBodyColor = 'red';
      }
      if (shoulderDiff > alignmentThreshold || hipDiff > alignmentThreshold) {
        upperBodyColor = 'red';
        lowerBodyColor = 'red';
      }

      // Drawing on canvas
      const ctx = canvasRef.current.getContext('2d');
      canvasRef.current.width = width;
      canvasRef.current.height = height;

      ctx.clearRect(0, 0, canvasRef.current.width, canvasRef.current.height);
      ctx.drawImage(image, 0, 0, canvasRef.current.width, canvasRef.current.height);

      drawLine(ctx, r1, r2, upperBodyColor);
      drawLine(ctx, r2, r3, upperBodyColor);
      drawLine(ctx, l1, l2, upperBodyColor);
      drawLine(ctx, l2, l3, upperBodyColor);
      drawLine(ctx, r1, l1, upperBodyColor);
      drawLine(ctx, r4, r5, lowerBodyColor);
      drawLine(ctx, r5, r6, lowerBodyColor);
      drawLine(ctx, l4, l5, lowerBodyColor);
      drawLine(ctx, l5, l6, lowerBodyColor);
      drawLine(ctx, r1, r4, lowerBodyColor);
      drawLine(ctx, l1, l4, lowerBodyColor);

      [r1, r2, r3, l1, l2, l3, r4, r5, r6, l4, l5, l6].forEach(joint => drawCircle(ctx, joint));

      // Push-up counting logic
      if (!hasError) {
        if (angleL < 90 && angleR < 90) {
          if (stage === 'up') {
            setCounter(prevCounter => prevCounter + 1);
            setStage('down');
          }
        }
        if (angleL > 90 && angleR > 90) {
          if (stage === 'down') {
            setStage('up');
          }
        }
      }
    };

    // Initialize Pose and Camera
    const pose = new Pose({
      locateFile: (file) => `https://cdn.jsdelivr.net/npm/@mediapipe/pose/${file}`
    });

    pose.setOptions({
      modelComplexity: 1,
      smoothLandmarks: true,
      minDetectionConfidence: 0.5,
      minTrackingConfidence: 0.5
    });

    pose.onResults(onResults);

    if (videoRef.current) {
      const camera = new Camera(videoRef.current, {
        onFrame: async () => {
          await pose.send({ image: videoRef.current });
        },
        width: 640,
        height: 480
      });
      camera.start();
    }

    // Cleanup on unmount
    return () => {
      pose.close();
    };
  }, [counter, stage]);

  // Helper functions for drawing on canvas
  const drawLine = (ctx, start, end, color) => {
    ctx.beginPath();
    ctx.moveTo(start[0], start[1]);
    ctx.lineTo(end[0], end[1]);
    ctx.strokeStyle = color;
    ctx.lineWidth = 4;
    ctx.stroke();
  };

  const drawCircle = (ctx, joint) => {
    ctx.beginPath();
    ctx.arc(joint[0], joint[1], 10, 0, 2 * Math.PI);
    ctx.fillStyle = 'white';
    ctx.fill();
  };

  // JSX rendering
  return (
    <div>
      <h1>Push-up Counter: {counter}</h1>
      <video ref={videoRef} width="640" height="480" style={{ display: 'none' }} />
      <canvas ref={canvasRef} />
    </div>
  );
};

export default PushupTracker;
